function exportRepositoriesAsWiki(){$.ajax({url:Urls.ExportSvnRepositoriesAsWiki,type:"get",success:function(n){$("#repositories-wiki-text").html(n);$("#export-as-wiki-modal").modal("show")}})}function exportRepositoriesAsWikiFile(){window.location.href=Urls.ExportSvnRepositoriesAsWikiFile}var $svnSearchText=$("#svn-repository-search"),$searchButton=$("#search-repository-button"),dataTable=$("#svn-repository-table").DataTable({language:{url:"//cdn.datatables.net/plug-ins/1.10.12/i18n/Turkish.json"},columnDefs:[{targets:1,type:"modifiedDate"}],processing:!0,serverSide:!1,searching:!0,paging:!0,lengthChange:!1,pageLength:10});$(document).ready(function(){$svnSearchText.on("keyup",function(n){n.keyCode===13&&dataTable.search($(this).val()).draw()});$searchButton.on("click",function(){dataTable.search($svnSearchText.val()).draw()});$.extend($.fn.dataTable.ext.type.order,{"modifiedDate-asc":function(n,t){var i=new Date(n),r=new Date(t);return i<r?1:-1},"modifiedDate-desc":function(n,t){var i=new Date(n),r=new Date(t);return i>=r?1:-1}});$("#export-as-wiki").on("click",()=>{exportRepositoriesAsWiki()});$("#export-as-wiki-file").on("click",()=>{exportRepositoriesAsWikiFile()})});